<!-- 非直传方式 -->
<template>
  <div>
    <p>
      1、支持格式（默认格式）如：[{name: "图片名称1", url: "base641", uid:
      "uid1"},{name: "图片名称2", url: "base642", uid: "uid2"}]
    </p>
    <zyl-upload-file
      v-model="fileList"
      :limit="3"
      changeBase64
      @addOneFile="addOneFile"
      @removeOneFile="removeOneFile"
    />

    <br />
    <br />

    <p>
      2、支持格式（需onlyUrlListBack开启）如：["base641", "base642", "base643"]
    </p>
    <zyl-upload-file
      v-model="fileList2"
      :limit="3"
      list-type="picture-card"
      changeBase64
      onlyUrlListBack
    />
  </div>
</template>

<script>
export default {
  data() {
    return {
      fileList: [
        {
          name: '图片名称1.jpg',
          url: 'data:image/jpeg;base64,',
          uid: 'fa39cb25b6d74e3e92b73704d0489e71',
        },
        {
          name: '图片名称2.jpg',
          url: 'data:image/png;base64,',
          uid: '0804824021f04a33813189666109880a',
        },
      ],
      fileList2: [
        'data:image/jpeg;base64,',
        'data:image/png;base64,',
      ],
    }
  },
  methods: {
    // 添加一个文件成功后的回调(changeBase64为非直传方式不会触发接口提交，可通过此处进行base64文件的存储和手动提交操作)
    addOneFile(file, fileList) {
      console.log('addOneFile', 'file', file, 'fileList', fileList)
    },
    // 删除一个文件成功后的回调(changeBase64为非直传方式不会触发接口提交，可通过此处进行base64文件的存储和手动提交操作)
    removeOneFile(file, fileList) {
      console.log('removeOneFile', 'file', file, 'fileList', fileList)
    },
  },
}
</script>
